	font-family: 'Inter', sans-serif;
	display:flex;
	flex-direction: row;
	gap:1rem;

	font-size:1rem;
	font-weight:700;
	text-transform: uppercase;
	padding: 0.5rem 1rem;

	box-sizing: border-box;
	border:0;
	border-radius: var(--border-radius-050);
	
	cursor: pointer;
	
	transition: background-color var(--time-025) ease-in;
