.primary {
	background-color: var(--dark-100);
	color: var(--white);
  
	&:hover{
		background-color: var(--dark-075);
		cursor: pointer;
	}

	&:disabled{
		background-color: var(--dark-025);
		cursor:not-allowed;
	}

	&.white{
		background-color: var(--white-100);
		color:var(--dark-100);

		&:hover{
			background-color: var(--white-075);
		}
	}

	&.info{
		background-color: var(--blue-100);
		color:var(--white-100);

		&:hover{
			background-color: var(--blue-075);
		}
	}
	
	&.danger,
	&.error{
		background-color:var(--red-100);
		color:var(--white-100);

		&.danger:hover,
		&.error:hover{
			background-color:var(--red-075);
		}
	}

	&.warning,
	&.caution{
		background-color:var(--yellow-100);
		color:var(--dark-100);

		&.warning:hover,
		&.caution:hover{
			background-color:var(--yellow-075);
		}
	}

	&.success{
		background-color:var(--green-100);
		color:var(--white-100);

		&.success:hover{
			background-color:var(--green-075);
		}
	}
}
.secondary {
	border:0 solid var(--dark-100);
	background-color: transparent;
	color:var(--dark-100);

	&:hover{
		background-color: var(--dark-010);
	}

	&:disabled{
		color:var(--dark-025);
		cursor:not-allowed;
		&:hover{
			background-color:transparent;
		}
	}

	&.white{
		color:var(--white-100);

		&:hover{
			background-color: var(--white-025);
			color:var(--white-100);
		}
	}

	&.info{
		color:var(--blue-100);

		&:hover{
			background-color: var(--blue-025);
			color:var(--blue-100);
		}
	}
	
	&.danger,
	&.error{
		color:var(--red-100);

		&:hover{
			background-color: var(--red-025);
			color:var(--red-100);
		}
	}

	&.warning,
	&.caution{
		color:var(--yellow-100);

		&:hover{
			background-color: var(--yellow-025);
			color:var(--yellow-100);
		}
	}

	&.success{
		color:var(--green-100);

		&:hover{
			background-color: var(--green-025);
			color:var(--green-100);
		}
	}
}
.ghost {
	border:var(--size-010) solid var(--dark-100);
	background-color: transparent;
	color:var(--dark-100);

	&:hover{
		background-color: var(--dark-010);
	}

	&:disabled{
		color:var(--dark-025);
	border-color:var(--dark-025);
	cursor:not-allowed;

		&:hover{
			background-color:transparent;
		}
	}

	&.white{
	color:var(--white-100);
	border-color:var(--white-100);

		&:hover{
			background-color: var(--white-025);
			color:var(--white-100);
		}
