ol,
ul{
	padding-left:0.5rem;
}

p ~ ol,
p ~ ul{
	margin-top:0rem;
	margin-bottom:1rem;
}

ul {
	line-height: 1.5em;
	/* margin: 5px 0 15px; */
	padding-left: 2.5rem;
}

li {
	list-style: none;
	position: relative;
	padding: 0;
}

ul li::before {
	content: "";
	position: absolute;
	left: -1.75rem;
	top: 0.5rem;
	height: 0.5rem;
	width: 0.5rem;
	border: 0.25rem solid var(--dark-100);
	border-width: var(--size-010) var(--size-010) 0 0;
	transform: rotate(45deg);
}

ol {
	counter-reset: item;
	list-style-type: none;
}

ol li {
	display: block;
	position: relative;
	left: 2rem;
	margin-right:2rem;
}

ol li:before {
	content: counter(item) " ";
	counter-increment: item;
	color: var(--white-100);
	position: absolute;
	left: -2.1rem;
	top: 0rem;
	background: var(--dark-100);
	height: 1.5rem;
	width: 1.5rem;
	font-size:1rem;
	text-align: center;
	border-radius: 50%;
	font-weight: 700;
	scale:0.75;
}

table{
	text-align:left;
	border-collapse: collapse;
	width: 100%;

	th{
		background-color:var(--dark-100);
		color:var(--white-100);
		font-weight:700;
		padding: var(--size-050);

		&:first-child{
			border-radius:var(--border-radius-050) 0 0 0;
		}

		&:last-child{
			border-radius:0 var(--border-radius-050) 0 0;
		}

		th:only-child{
			border-radius: var(--border-radius-050) var(--border-radius-050) 0 0;
		}
	}

	tr{

		&:last-child{
			border-bottom:var(--size-010) solid var(--dark-100);
		}

		&:nth-child(odd){
			background-color: var(--dark-005);
		}
	}

	td{
		padding:var(--size-050);
	}
	
	tr:hover,
	tc:hover{
		background-color: var(--dark-010);

	}
}

